import React from "react";
import "./about.css";

const About = () => {
  return (
    <div className="about--container">
      <div>
        <h1>Information about the game</h1>
        <div>
          <h2>Description</h2>
        </div>
        <div>
          <h2>Gameplay</h2>
        </div>
        <div>
          <h2>End notes</h2>
        </div>
      </div>
    </div>
  );
};

export default About;
